@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    MenuInfoComponent,
    BigCardComponent,
    EspecialidadesComponent,
    SaboresComponent,
    PedidoComponent,
    CardapioComponent,
    DaCasaComponent

  ],
